<!DOCTYPE html><html lang="en">
<?php include('admin/head.php'); ?>
<?php include('admin/header.php'); ?>
<style>
  
  #cal{
   overflow:hidden;
   padding:50px;
   background:white;
   width:96%;
   margin:50px auto;
   border:1px solid #eee;
   border-radius:20px;
   box-shadow: rgba(17, 17, 26, 0.05) 0px 1px 0px, rgba(17, 17, 26, 0.1) 0px 0px 8px;
  }
.prog {
    display: block;
    width: 96%;
    height: 71px;
    padding-top: 25px;
}
.prog ul {
    display: block;
    font-size: 14px;
    line-height: 16px;
    list-style: none;
    position: relative;
    margin: 0 10px;
    padding: 0;
}
.prog li {
    float: left;
    position: relative;
    width: 20%;
    height: 20px;
}
.region-content .qbcalc .prog a {
    width: 38px;
    height: 38px;
}
.prog .active a, .prog .completed a {
    background: #2f3ea8;
    color: #fff;
    border: none;
    margin-top: -9px;
    padding: 11px;
}
.prog a {
    background: #fff;
    border: 3px solid #ddd;
    border-radius: 50%;
    color: #666;
    float: left;
    text-align: center;
    text-decoration: none;
    width: 16px;
    height: 16px;
    position: absolute;
    margin-top: -8px;
    left: -10px;
    z-index: 3;
    padding: 8px;
    font-size: 17px;
    font-weight: bold;
    transition: all linear 200ms;
}
.prog div {
    background: #ddd;
    float: left;
    width: 100%;
    height: 5px;
    position: relative;
    top: 9px;
    z-index: 1;
    transition: all linear 300ms;
}
form {
    display: block;
    margin-top: 0em;
    unicode-bidi: isolate;
}
@media screen and (max-width: 1000px) {
    .mobile-label {
        display: block;
        margin: 0px 0px 4px;
        font-weight: bold;
        color: rgb(85, 85, 85);
    }
}
.mobile-label {
    display: none;
}

p {
    margin: 0 0 10px;
}
@media screen and (max-width: 1000px) {
    .qbcalc input.left-input {
        margin-right: 0px;
    }
}
@media screen and (max-width: 1000px) {
    .qbcalc input, .qbcalc input[type="text"] {
        width: 99%;
        max-width: 100%;
        text-align: left;
        padding-left: 9px;
    }
}
input:not([type="checkbox"]):not([type="radio"]) {
    appearance: none;
}
.qbcalc input.left-input {
    margin-right: 1%;
}
.qbcalc input[type="text"] {
    text-align: right;
    margin-top: 14px;
    margin-bottom: 15px;
}
.qbcalc input {
    border-radius: 6px;
    border: 2px solid rgb(204, 204, 204);
    width: 49%;
    max-width: 300px;
    height: 47px;
    position: relative;
    font-weight: bold;
    color: rgb(119, 119, 119);
    margin-top: 13px;
    padding-right: 9px;
}
@media screen and (max-width: 1000px) {
    .mobile-label {
        display: block;
        margin: 0px 0px 4px;
        font-weight: bold;
        color: rgb(85, 85, 85);
    }
}
</style>

